<?phpnamespace KooijmanInc\Suzie\Object\FormObject;use KooijmanInc\Suzie\FormBuilder\FormParts\Input\InputInterface;use KooijmanInc\Suzie\SuzieInterface;use Traversable;class ObjectStorage implements ObjectInterface{    public function __construct(SuzieInterface $suzie = null)    {    }    public function attach(object &$object, string $name = null): bool    {        return ($this->{$name} = $object) ? true : false;    }    public function getIterator(): Traversable    {        return new \ArrayIterator($this);    }}